import Quiz from './quiz';
import Shop from './shop';
import Order from './order';
import Confirmation from './confirmation';
import './navbar.css';
import logo from './logo.svg';

const Navbar = () => {
    return (  
        <div>
            <nav class="navbar navbar-dark">
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <img src={logo} width= "100px" height="100px" alt="logo"></img>

            </nav><div class="collapse navbar-collapse" id="navbarText">
                    <ul class="navbar-nav mr-auto">
                        <li class="nav-item">
                            <a class="nav-item" href= "Home.js">Home</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-item" href="Shop.js">Shop</a>
                        </li>
                        <li class="nav-item active">
                            <a class="nav-item-active" href="Order.js">Order</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-item" href="Quiz.js">Coffee Quiz</a>
                        </li>
                    </ul>
                </div>
            </div>
    );
}

export default Navbar;
